import { Route, Routes } from "react-router-dom";
import BoardList from "./pages/BoardList";
import BoardContent from "./pages/BoardContent";

function App() {
  <Routes>
    <Route path="/" element={<BoardList />} />
    <Route path="/content" element={<BoardContent />} />
  </Routes>;
}

export default App;
